// src/components/LoginHeader.js
import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import { useCart } from '../CartContext'; // Correct import
import { FaCartPlus, FaUserCircle } from 'react-icons/fa'; // Import icons

function LoginHeader() {
  const { cart, orders, cancelOrder } = useCart(); // Correctly use useCart
  const [showDropdown, setShowDropdown] = useState(false);
  const [selectedOrder, setSelectedOrder] = useState(null);

  const cartItemCount = cart.length; // Number of items in the cart

  // Function to toggle dropdown visibility
  const toggleDropdown = () => {
    setShowDropdown(prev => !prev);
  };

  // Handle dropdown selection for past orders
  const handleOrderSelect = (order) => {
    setSelectedOrder(order);
    setShowDropdown(false);
  };

  return (
    <header className="header">
      <div className="width">
        <Link to="/" className="logo">
          <h1>Smart Homes</h1>
        </Link>
      </div>
      <nav>
        <ul>
          <li><Link to="/">Home</Link></li>
          <li><Link to="/products/doorbells">Smart Doorbell</Link></li>
          <li><Link to="/products/doorlocks">Smart Doorlock</Link></li>
          <li><Link to="/products/lighting">Smart Lighting</Link></li>
          <li><Link to="/products/speakers">Smart Speaker</Link></li>
          <li><Link to="/products/thermostats">Smart Thermostat</Link></li>
        </ul>
        <div className="header-icons">
          <Link to="/cart" className="cart-icon">
            <FaCartPlus size={24} />
            {cartItemCount > 0 && (
              <span className="cart-badge">{cartItemCount}</span>
            )}
          </Link>
          <div className="account-menu">
            <span onClick={toggleDropdown} className="account-icon">
              <FaUserCircle size={24} />
            </span>
            {showDropdown && (
              <div className="dropdown-menu">
                <Link to="/account">Account Information</Link>
                <h3>Past Orders</h3>
                <ul>
                  {orders.map(order => (
                    <li key={order.id}>
                      <button onClick={() => handleOrderSelect(order)}>
                        Order #{order.confirmationNumber}
                      </button>
                    </li>
                  ))}
                </ul>
                {selectedOrder && (
                  <div className="order-details">
                    <h4>Order Details</h4>
                    <p>Confirmation Number: {selectedOrder.confirmationNumber}</p>
                    <p>Delivery Date: {selectedOrder.deliveryDate.toDateString()}</p>
                    <button onClick={() => cancelOrder(selectedOrder.id)}>Cancel Order</button>
                  </div>
                )}
              </div>
            )}
          </div>
        </div>
      </nav>
    </header>
  );
}

export default LoginHeader;
